import React, { Component } from "react";
import { Row, Col, Card } from "react-materialize";

export default class CardMap extends Component {
  render() {
    return (
      <div>
        <Row>
          <Col m={6} s={12}>
            <Card
              className="blue-grey darken-1"
              textClassName="white-text"
              title="Card title"
              actions={[<a />, <a />]}
            >
              I am a very simple card.
            </Card>
          </Col>
        </Row>
      </div>
    );
  }
}
